import React from 'react';

const WorkProfiles = (props) => {
    const styles = {
        backgroundColor: props.backgroundColor,
        color: props.color,
        border: "black solid",
        display: "grid",
        gridGap: "25px"
        // justifyContent: "space-around"

    }
    return (
        <div style={styles}>
            <p>Name: </p>
            <p>Title:</p>
            <p>Info:</p>

        </div>
    )
}

export default WorkProfiles
